import { Component } from '@angular/core';

import { SingleTrack } from '../single-track';

@Component({
  selector: 'app-single-track-form',
  templateUrl: './single-track-form.component.html',
  styleUrls: ['./single-track-form.component.css']
})
export class SingleTrackFormComponent {

  //powers = ['Really Smart', 'Super Flexible',
  //          'Super Hot', 'Weather Changer']; 240

  model = new SingleTrack("", "", "", 0);

  submitted = false;

  onSubmit() { this.submitted = true; console.log("onSubmit()");}

  scrobbleTrack() {
    console.log("Scrobbling request received");
    this.model = new SingleTrack("", "", "", 0);
  }

  sampleTrack(): SingleTrack {
    const sampleTrack =  new SingleTrack("The Beatles", "The Beatles", "While My Guitar Gently Weeps", 440);
    console.log('My sample song is called ' + sampleTrack.title); // "My hero is called SkyDog"
    return sampleTrack;
  }

  //////// NOT SHOWN IN DOCS ////////

  // Reveal in html:
  //   Name via form.controls = {{showFormControls(heroForm)}}
  showFormControls(form: any) {
    return form && form.controls.name &&
    form.controls.name.value; // Dr. IQ
  }
}
